import React from "react";
import { Routes, Route } from "react-router-dom";
import SidebarMenu from "../components/SidebarMenu";
import AdminDashboard from "../pages/Admin/AdminDashboard";
import Index from "../pages/Admin/Destination/Index";
import BookingIndex from "../pages/Admin/Booking/Index";
import TourDetail from "../pages/Admin/Tours/Index"; // Dynamic Tour Details by ID

function AdminLayout() {
  return (
    <div className="d-flex">
      {/* Sidebar always appears for admin routes */}
      <SidebarMenu />

      {/* Admin Content */}
      <div className="flex-grow-1 p-3">
        <Routes>
          <Route path="dashboard" element={<AdminDashboard />} />
          <Route path="destination/index" element={<Index />} />
          <Route path="bookings" element={<BookingIndex />} />
          <Route path="tours/:id" element={<TourDetail />} />
        </Routes>
      </div>
    </div>
  );
}

export default AdminLayout;
